const userDefaultState = {
    id: "",
    email: "",
    password: ""
}

const userReducer = (state = userDefaultState,action)=>{
    switch(action.type){
        case 'CREATE_USER':
            return {
                ...state,
                ...action.payload
            }
        default:
            return state;
    }
}

export default userReducer;
